import React from 'react';
import { Row, Col } from 'react-bootstrap';
import './Footer.css';

export const Footer = () => {
  return(
  <div className='Footer'>
      <Row>
        <Col>
          <h6> © SportStore </h6>
        </Col>
        <Col></Col>
      </Row>
  </div>
  );
};

export default Footer;
